import { Container, withStyles } from "@material-ui/core";


export const SectionContainer = () => {
    return withStyles({
        root: {
            backgroundImage: "url(/img/header_club_green.png)",
            paddingTop: "32px",
            paddingBottom: "32px"
        },
      })(Container);
}

export const TopSectionContainer = () => {
    return withStyles({
        root: {
            backgroundImage: "url(/img/header_club_green.png)",
            paddingTop: "32px",
            paddingBottom: "32px"
        },
      })(Container);
}
